	(1,1,'LUCH 6åŠå…¬å®¤ï¼Œ','Team','ç™½ä¿„ç½—æ–¯','','1200',NULL,'å¯Œäºå»ºç­‘å…ƒç´ çš„æ•´æ´ç©ºé—´ï¼Œå»ºç­‘ç»“æ„ ã€‚æ··å‡åœŸ','å»ºç­‘å…ƒç´       æ•´æ´    æ©™è‰²','<p><span style=\"color: rgb(0, 0, 0); font-family: å®‹ä½“;\">è®¾è®¡å›¢é˜Ÿå—é‚€è®¾è®¡ä½äºæ˜æ–¯å…‹</span><span style=\"color: rgb(0, 0, 0);\">Luch</span><span style=\"color: rgb(0, 0, 0); font-family: å®‹ä½“;\">é’Ÿè¡¨å‚çš„ç‹¬ç‰¹åœºåœ°ï¼Œè¯¥é¡¹ç›®ä¹Ÿå› æ­¤è€Œå‘½åã€‚è¿™åº§å†å²æ‚ ä¹…çš„å»ºç­‘äºè¿‘æœŸé‡å»ºï¼Œå…¶ä¸­ä¸€éƒ¨åˆ†å‡ºç§Ÿç»™å…¶ä»–å…¬å¸ï¼Œè¿™äº›å…¬å¸çš†éµå¾ªé‚»è¿‘é’Ÿè¡¨å‚çš„åŠå…¬å®¤è®¾è®¡ç†å¿µã€‚</span><span style=\"color: rgb(0, 0, 0);\">Glera Games</span><span style=\"color: rgb(0, 0, 0); font-family: å®‹ä½“;\">æ¸¸æˆå…¬å¸å°†å ç”¨å»ºç­‘ä¸Šå±‚çš„</span><span style=\"color: rgb(0, 0, 0);\">1031</span><span style=\"color: rgb(0, 0, 0); font-family: å®‹ä½“;\">ã¡ï¼Œé«˜å¤©èŠ±åŠè®¸å¤šå¯¹ç§°çª—æˆ·å¸¦æ¥ä¸°å¯Œçš„è‡ªç„¶å…‰å’Œä½“é‡æ„Ÿã€‚å»ºç­‘ä¸å®¤å†…ç›¸äº’å½±å“ï¼Œè®¾è®¡å›¢é˜Ÿä»¥æ­¤ä¸ºåŸºç¡€ï¼Œä¸“æ³¨äºæ‰“é€ æœ´å®æ— åçš„åŠå…¬ç©ºé—´ï¼Œä¸ç®€æ´è€Œç°ä»£çš„å»ºç­‘å¤–è§‚åŠå…¶ç«‹é¢å°ºåº¦ç›¸åŒ¹é…ã€‚ </span></p><p style=\"text-align: left;\"><span style=\"color: rgb(0, 0, 0);\">We received a unique site at Luch Watch Plant in Minsk, so the project was named after it. The historical building had recently been reconstructed and a part of it was rented out to companies, following the concept of offices neighboring watches manufactory. Glera Games was to occupy 1031 m2 on the upper level of the building. High ceilings and many symmetrically rhythmic windows provide fantastic natural light and volume. As the architecture affects the interior, the interior affects the architecture, this works both ways. We took this concept as a basis and focused on creating a functional non-decorative interior. We designed the office space to match the modern and laconic appearance of the building and the dimensional spacing of its facade. </span></p><p style=\"text-align: left;\"><span style=\"color: rgb(0, 0, 0); font-family: å®‹ä½“;\">â–¼ç©ºé—´æ¦‚è§ˆï¼Œ</span><span style=\"color: rgb(0, 0, 0);\">preview Â©Lizaveta Kulenenok</span><img src=\"/uploads/files/P5OqvNEoVpXVcL5GiRpkKFZMfa5rn5Vv.jpeg\" alt=\"\" data-href=\"\" style=\"\"></p><p><span style=\"color: rgb(0, 0, 0); font-family: å®‹ä½“;\">è®¾è®¡é‡ç‚¹åœ¨äºä½“é‡çš„æ„æˆä¸ç»„åˆä»¥åŠæ— çª—å¢™é‡‡å…‰å£çš„è¥é€ ã€‚å®¤å†…æ•´ä½“è‰²è°ƒååˆ†ç¦æ¬²å¹¶ä¸”ä¸»è¦ç”±ä¸¤ç§é¢œè‰²ç»„æˆï¼šç”¨äºå¤©èŠ±ã€å¢™å£ã€å®¶å…·åŠåœ°é¢è£…é¥°çš„å•ä¸€ç°è‰²ï¼Œä»¥åŠç”¨äºå¹³è¡¡å®¤å†…èƒŒæ™¯è‰²è°ƒçš„é»‘è‰²ã€‚æ­¤å¤–ï¼Œè®¾è®¡å›¢é˜Ÿè¿˜ä½¿ç”¨æ©™è‰²æäº®ç©ºé—´ï¼Œä½¿ç”¨çº¢è‰²æé«˜ç©ºé—´å¯¹æ¯”åº¦å¹¶ä¸”å‘¼åº”å…¬å¸å“ç‰Œä¸»æ‰“è‰²å½©â€”â€”æš–æ©™è‰²ã€‚ </span></p><p style=\"text-align: left;\"><span style=\"color: rgb(0, 0, 0);\">The emphasis was put on the composition of volumes, their combinations and the creation of light openings in blind walls. The color gamut is quite ascetic and consists of 2 major colors: monochromatic gray used for ceilings, walls, furniture, floor coverings, and black used to balance the interior background. We added some orange as a bright accent, as well as red to achieve the required contrast in space and create additional associations with the main company brand color â€“ warm orange. </span></p><p style=\"text-align: left;\"><span style=\"color: rgb(0, 0, 0); font-family: å®‹ä½“;\">â–¼æ©™è‰²æäº®ç°è‰²ç©ºé—´ï¼Œ</span><span style=\"color: rgb(0, 0, 0);\">orange brightens gray space Â©Lizaveta Kulenenok</span><img src=\"/uploads/files/DE71wN07xrRer6dzm1EPBmaLNiZ9llrw.jpg\" alt=\"\" data-href=\"\" style=\"width: 1064.00px;height: 1580.44px;\"><span style=\"color: rgb(0, 0, 0); font-family: å®‹ä½“;\">â–¼èµ°å»Šä¸­çš„æ©™è‰²å¢™é¢ï¼Œ</span><span style=\"color: rgb(0, 0, 0);\">orange wall in corridor Â©Lizaveta Kuleneno</span><img src=\"/uploads/files/vfvCb3qZpj2Qr6y35mGY3aBv1DQL4ibS.jpg\" alt=\"\" data-href=\"\" style=\"width: 1062.00px;height: 1593.00px;\"></p><p><span style=\"color: rgb(0, 0, 0); font-family: å®‹ä½“;\">åŠå…¬å±‚åˆ†ä¸º</span><span style=\"color: rgb(0, 0, 0);\">4</span><span style=\"color: rgb(0, 0, 0); font-family: å®‹ä½“;\">ä¸ªåŒºåŸŸï¼š </span></p><p><span style=\"color: rgb(0, 0, 0);\">1. </span><span style=\"color: rgb(0, 0, 0); font-family: å®‹ä½“;\">å…¥å£åŒºåŸŸï¼šå‰å°ã€è¡£æŸœã€é—¨å…ã€ç­‰å€™åŒºã€‚ </span></p><p><span style=\"color: rgb(0, 0, 0);\">2. </span><span style=\"color: rgb(0, 0, 0); font-family: å®‹ä½“;\">å…¬å…±åŒºåŸŸï¼šç”¨äºæ—¥å¸¸äº¤æµå’Œæ¼”ç¤ºçš„å¼€æ”¾å‰§åœºã€å¸¦æœ‰ä¸´æ—¶åŠå·¥æ¡Œçš„ä¼‘é—²åŒºã€é¤å¨ç©ºé—´</span></p><p><span style=\"color: rgb(0, 0, 0);\">3. </span><span style=\"color: rgb(0, 0, 0); font-family: å®‹ä½“;\">å·¥ä½œåŒºåŸŸï¼šå¼€æ”¾ç©ºé—´ã€ä¸ªäººåŠå…¬å®¤ã€‚ </span></p><p><span style=\"color: rgb(0, 0, 0);\">4. </span><span style=\"color: rgb(0, 0, 0); font-family: å®‹ä½“;\">ä¼šè®®åŒºåŸŸï¼šå¼€æ”¾å¼å’Œå°é—­å¼ä¼šè®®å®¤å‡åŒ€åˆ†å¸ƒåœ¨æ•´ä¸ªåŠå…¬ç©ºé—´ï¼Œæ–¹ä¾¿ä½¿ç”¨ã€‚å¤§å°ä¼šè®®å®¤æ—¢å¯ä»¥ç”¨äºè¿œç¨‹åŠå…¬ï¼Œä¹Ÿå¯ä»¥ç”¨äº</span><span style=\"color: rgb(0, 0, 0);\">2</span><span style=\"color: rgb(0, 0, 0); font-family: å®‹ä½“;\">è‡³</span><span style=\"color: rgb(0, 0, 0);\">10</span><span style=\"color: rgb(0, 0, 0); font-family: å®‹ä½“;\">äººå›¢é˜Ÿç¦»çº¿åŠå…¬ã€‚</span></p><p style=\"text-align: left;\"><span style=\"color: rgb(0, 0, 0);\">The office level is divided into 4 zones: </span></p><p style=\"text-align: left;\"><span style=\"color: rgb(0, 0, 0);\">1. Entrance area: reception desk, wardrobe, elevator hall, waiting area. </span></p><p style=\"text-align: left;\"><span style=\"color: rgb(0, 0, 0);\">2. Common area: amphitheater for informal communication and presentations, recreational area with desks for short-term work, kitchen combined with dining room. </span></p><p style=\"text-align: left;\"><span style=\"color: rgb(0, 0, 0);\">3. Working area: open space, individual offices. </span></p><p style=\"text-align: left;\"><span style=\"color: rgb(0, 0, 0);\">4. Meetings area: open and closed meeting rooms are evenly distributed across the office space for the convenience of use. Meeting rooms of M and S size